    <style>
        /**
         * 图标示例样式(这里单独放页面中)
         * example-icons
         */
        .example-icons {
            padding: 0 20px 10px 20px;
            -webkit-column-count: 12;
            -moz-column-count: 12;
            column-count: 12;
            -webkit-column-gap: 20px;
            -moz-column-gap: 20px;
            column-gap: 20px;
        }
        .example-icons div {
            line-height: 3em;
        }
        .example-icons div span {
            cursor: pointer;
            font-size: 14px;
            text-overflow: ellipsis;
            display: inline-block;
            max-width: calc(100% - 90px);
            overflow: hidden;
            vertical-align: middle;
            white-space: nowrap;
        }
        .example-icons div code:hover,
        .example-icons div span:hover,
        .example-icons div i:hover {
            color: #33cabb;
        }
        .example-icons div code:hover {
            border-color: #33cabb;
        }
        .example-icons div code {
            border: 1px solid #DDD;
            width: 46px;
            margin-left: 2px;
            margin-right: 4px;
            border-radius: 4px;
            display: inline-block;
            vertical-align: middle;
            text-align: center;
            line-height: 24px;
            cursor: pointer;
        }
        .example-icons div i {
            display: inline-block;
            width: 32px;
            height: 24px;
            text-align: center;
            vertical-align: middle;
            cursor: pointer;
            line-height: 24px;
        }
        .example-icons .mdi:before {
            font-size: 24px;
        }
    </style>
</head>

<script>
    var parentinputname = '{$Request.param.fodder}';
    $('.example-icons div').on('click', function () {
        var className = $(this).find('i').get(0).className;
        if (className) {
            console.log(className);
            parent.$f.changeField(parentinputname,className);
            parent.$f.closeModal(parentinputname);
        }
    });

    //搜索图标
    $("#search").on('input',function () {
        var keyword = $(this).val();
        if(keyword){
            $(".example-icons div i").hide();
            $("i[class*='"+keyword+"']").show();
        }else{
            $(".example-icons div i").show();
        }
    });
</script>
